import React from "react";

import { Link, useNavigate } from "react-router-dom";

export default function LoginPage() {
  return (
    <div>
      <div>
        <Link to="/register">Nav To Register With Link</Link>
      </div>
      <div>
        <a href="/register">Nav To Register With Anchor</a>
      </div>
    </div>
  );
}
